const input = [ 
    {
        name: 'Oslo',
        value: 50,
        className: 'by'
    },
    {
        name: 'Trondheim',
        value: 20,
        className: 'by'
    },
    {
        name: 'Stavanger',
        value: 10,
        className: 'by'
    },
    {
        name: 'Bergen',
        value: 20,
        className: 'by'
    },
]


class Treemap extends Component {
    render() {
        return (
            <TreeMap
              id="myTreeMap"
              height={900}
              width={1000}
              data={input}
              valueUnit={"%"}
              colorModel={0}
              disableBreadcrumb
            />
          );
    }
}

export default TreeMap;
